@import url('https://fonts.googleapis.com/css2?family=Quicksand:wght@700&display=swap');


body {
    margin: 0;
    font-family: 'Quicksand', sans-serif;-apple-system,BlinkMacSystemFont,Segoe UI,Roboto,Helvetica Neue,Arial,Noto Sans,sans-serif,Apple Color Emoji,Segoe UI Emoji,Segoe UI Symbol,Noto Color Emoji;
    font-size: 1rem;
    font-weight: 400;
    line-height: 1.5;
    color: #212529;
    text-align: left;
    background-color: #fff;
}
@decimal-format .prices__value {
  grouping-separator: ",";
  decimal-separator : "."
}

.top-bar__nav {
    max-width: 80rem;
    color: #ffffff;
    margin-left: auto;
    background-color: #000000;
    margin-right: auto;
    padding: var(--spacer-2) var(--spacer-2) var(--spacer-1);
}

.top-bar a.top-bar__countdown {
    background: var(--primary);
    color: var(--primary-yiq);
    font-weight:800;
    font-size:20px;
}

.top-bar__page-links a {
    margin-right: var(--spacer-3);
    font-weight: 800;
    /* font-size: 16px; */
}

.top-bar__page-links a {
    font-weight: 700;
}
